import jsPDF from "jspdf";
(function (jsPDFAPI) {
  const marianneRegular =
    "";
  var callAddFont = function () {
    this.addFileToVFS("Marianne-Regular.ttf", marianneRegular);
    this.addFont("Marianne-Regular.ttf", "MarianneRegular", "normal");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
